import React, {useState} from 'react'
import axios from 'axios'
import {useNavigate} from 'react-router-dom'

const CreateUser = () => {

    const [username, setUsername] = useState()
    const [password, setPassword] = useState()
    const navigate = useNavigate()

    const Submit = (e) => {
        e.preventDefault();
        axios.post("http://localhost:3001/createUser", {username, password})
        .then(result => {
            console.log(result)
            navigate('/')
        })
        .catch(err => console.log(err))
    }

  return (
    <div className='d-flex vh-100 bg-primary justify-content-center align-items-center'>
        <div className='w-50 bg-white rounded p-3'>
            <form onSubmit={Submit}>
                <h2>Add User</h2>
                <div className='mb-2'>
                    <label htmlFor=''>Username</label>
                    <input type='text' placeholder='Enter Username' className='form-control' onChange={(e) => setUsername(e.target.value)}></input>
                </div>
                <div className='mb-2'>
                    <label htmlFor=''>Password</label>
                    <input type='text' placeholder='Enter Password' className='form-control' onChange={(e) => setPassword(e.target.value)}></input>
                </div>
                <button className='btn btn-success'>Submit</button>
            </form>
        </div>
    </div>
  )
}

export default CreateUser
